import React from "react";

const HeroMain = () => {
  return (
    <div className="relative">
      <h1 className="text-[15em] bg-clip-text text-transparent bg-gradient-to-r from-green-600 to-green-400 tracking-tighter">
        Kode!
      </h1>

      <div className="w-[6em] h-[6em] bg-green-400 rounded-full absolute top-40 left-[10em] -z-10" />
    </div>
  );
};

export default HeroMain;
